import React from 'react'

class Questions1 extends React.Component {
    constructor(props) {
        super(props)
        this.state = {}
    }

    render() {
        const props = this.props

        if (props.currentStep !== 1) {
          return null;
        }

        return (
            <div>
                <p>Questions One</p>
                <label htmlFor="input-11">One - Question one</label>
                <input id="input-11" type="checkbox" onChange={ props.onUpdateSelected } defaultChecked={Object.values(props.selected).indexOf('input-11') > -1} /><br />
                <label htmlFor="input-12">One - Question two</label>
                <input id="input-12" type="checkbox" onChange={ props.onUpdateSelected } /><br />
                <label htmlFor="input-13">One - Question three</label>
                <input id="input-13" type="checkbox" onChange={ props.onUpdateSelected } /><br />
            </div>
        )
    }
}

export default Questions1
